import Link from "next/link";
const NaveBar = () => (
  <nav>
    <ul className="conten-nav">
      <li>
        <button className="btn btn-success"> Create </button>
      </li>
      <li>
        <button className="btn btn-danger"> Delete </button>
      </li>
    </ul>
  </nav>
);
export default NaveBar;
